begin
insert Animal(vAnimalName,
vAnimalCategory,vAnimalHeight,vAnimalWeight ,
vAnimalColor,vAnimalSex,vAnimalPrice ,iAnimalStock,
varAnimalImage,vSellerName,vSellerAddress,
vSellerPhone,vSellerEmail,iAnimalAge)
values(@vAnimalName,
@vAnimalCategory,@vAnimalHeight,@vAnimalWeight,
@vAnimalColor,@vAnimalSex,@vAnimalPrice,@iAnimalStock,
@varAnimalImage ,@vSellerName,@vSellerAddress,
@vSellerPhone,@vSellerEmail,@iAnimalAge)
end

